import React from 'react';
import { Box, Grid, Paper, Stack, Typography } from '@mui/material';
import "./styles.css";
import { Link } from 'react-router-dom';

const canvases = [ 'Stickies', 'Notepad', 'Blank canvas'];

const HomePage = ()  => {
  return (
    <Stack
      spacing={2}
      sx={{ p: 2 }}
    >
      <Typography variant="h2">
          Welcome to Jot
        </Typography>
        <Typography variant="subtitle1">
          Pick your canvas
        </Typography>
        <Grid container>
          <Grid item container columnSpacing={3} sx={{ justifyContent: 'center' }}>
            {canvases.map(( item ) => (
              <Grid item xs={3}>
                <Box component={Paper} sx={{ borderColor: 'gray', textAlign: 'center', py: 12 }}>
                  <Typography component={Link} to={`/${item.toLowerCase().split(' ').join('')}`}>{item}</Typography>
                </Box>
              </Grid>
            ))}
          </Grid>
        </Grid>
    </Stack>
  );
};

export default HomePage;
